import React from "react";
import logo from "../assets/logo.png";

const Header = () => {
  return (
    <header>
      <div className="logo">
        <img src={logo} alt="Taskmate Logo"></img>
        <spn>TASKMATE</spn>
      </div>
      <div className="themeSelector">gg</div>
    </header>
  );
};

export default Header;
